// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract RequestManager {
    enum Status { PENDING, APPROVED, REJECTED, IN_PROGRESS, FULFILLED }

    struct Request {
        uint256 id;
        address requester;
        string item;
        uint256 quantity;
        Status status;
        bool exists;
    }

    mapping(uint256 => Request) public requests;
    uint256 public nextRequestId;

    address[3] public peers;

    constructor(address[3] memory _peers) {
        peers = _peers;
    }

    modifier onlyPeer() {
        bool allowed = false;
        for (uint i = 0; i < peers.length; i++) {
            if (msg.sender == peers[i]) {
                allowed = true;
                break;
            }
        }
        require(allowed, "Not authorized peer");
        _;
    }

    event RequestCreated(uint256 id, address requester, string item, uint256 quantity);
    event RequestStatusUpdated(uint256 id, Status status);

    function createRequest(string memory _item, uint256 _quantity) external returns (uint256) {
        uint256 reqId = nextRequestId++;
        requests[reqId] = Request(reqId, msg.sender, _item, _quantity, Status.PENDING, true);
        emit RequestCreated(reqId, msg.sender, _item, _quantity);
        return reqId;
    }

    mapping(uint256 => mapping(address => bool)) private approveCount;
    mapping(uint256 => uint8) private approvalNum;

    function approveRequest(uint256 _id, Status _newStatus) external onlyPeer {
        require(requests[_id].exists, "Request not found");
        Status current = requests[_id].status;

        require(
            (current == Status.PENDING && (_newStatus == Status.APPROVED || _newStatus == Status.REJECTED)) ||
            (current == Status.APPROVED && _newStatus == Status.IN_PROGRESS) ||
            (current == Status.IN_PROGRESS && _newStatus == Status.FULFILLED),
            "Invalid status transition"
        );

        require(!approveCount[_id][msg.sender], "Already approved");
        approveCount[_id][msg.sender] = true;
        approvalNum[_id] += 1;

        if (approvalNum[_id] >= 2) {
            requests[_id].status = _newStatus;
            emit RequestStatusUpdated(_id, _newStatus);
        }
    }
}

contracts/StockManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract StockManager {
    struct Stock {
        string name;
        uint256 quantity;
        bool exists;
    }

    mapping(uint256 => Stock) public stocks;
    uint256 public nextStockId;

    address[3] public peers;

    constructor(address[3] memory _peers) {
        peers = _peers;
    }

    modifier onlyPeer() {
        bool allowed = false;
        for (uint i = 0; i < peers.length; i++) {
            if (msg.sender == peers[i]) {
                allowed = true;
                break;
            }
        }
        require(allowed, "Not authorized peer");
        _;
    }

    event StockCreated(uint256 id, string name, uint256 quantity);
    event StockUpdated(uint256 id, string name, uint256 quantity);
    event StockDeleted(uint256 id);

    mapping(uint256 => mapping(address => bool)) private createApprovals;
    mapping(uint256 => uint8) private createCount;

    function proposeStock(string memory _name, uint256 _quantity) external onlyPeer returns (uint256) {
        uint256 id = nextStockId++;
        createApprovals[id][msg.sender] = true;
        createCount[id] = 1;
        stocks[id] = Stock(_name, _quantity, false);
        return id;
    }

    function approveStock(uint256 _id) external onlyPeer {
        require(!stocks[_id].exists, "Already created");
        require(!createApprovals[_id][msg.sender], "Already approved");
        createApprovals[_id][msg.sender] = true;
        createCount[_id] += 1;

        if (createCount[_id] >= 2) {
            stocks[_id].exists = true;
            emit StockCreated(_id, stocks[_id].name, stocks[_id].quantity);
        }
    }

    function updateStock(uint256 _id, string memory _name, uint256 _quantity) external onlyPeer {
        require(stocks[_id].exists, "Stock not found");
        stocks[_id].name = _name;
        stocks[_id].quantity = _quantity;
        emit StockUpdated(_id, _name, _quantity);
    }

    function deleteStock(uint256 _id) external onlyPeer {
        require(stocks[_id].exists, "Stock not found");
        delete stocks[_id];
        emit StockDeleted(_id);
    }
}

contracts/UserManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract UserManager {
    struct User {
        string name;
        bool exists;
    }

    mapping(address => User) public users;

    address[3] public peers;

    constructor(address[3] memory _peers) {
        peers = _peers;
    }

    modifier onlyPeer() {
        bool allowed = false;
        for (uint i = 0; i < peers.length; i++) {
            if (msg.sender == peers[i]) {
                allowed = true;
                break;
            }
        }
        require(allowed, "Not authorized peer");
        _;
    }

    event UserSignedUp(address indexed user, string name);
    event UserSignedIn(address indexed user);
    event UserSignedOut(address indexed user);
    event UserUpdated(address indexed user, string newName);
    event UserDeleted(address indexed user);

    function signup(string memory _name) external {
        require(!users[msg.sender].exists, "User exists");
        users[msg.sender] = User(_name, true);
        emit UserSignedUp(msg.sender, _name);
    }

    mapping(address => mapping(address => bool)) private deleteApprovals;
    mapping(address => uint8) private deleteCount;

    function approveDelete(address _user) external onlyPeer {
        require(users[_user].exists, "User not found");
        require(!deleteApprovals[_user][msg.sender], "Already approved");
        deleteApprovals[_user][msg.sender] = true;
        deleteCount[_user] += 1;

        if (deleteCount[_user] >= 2) {
            delete users[_user];
            deleteCount[_user];
            emit UserDeleted(_user);
        }
    }

    function signin() external {
        require(users[msg.sender].exists, "User not registered");
        emit UserSignedIn(msg.sender);
    }

    function signout() external {
        require(users[msg.sender].exists, "User not registered");
        emit UserSignedOut(msg.sender);
    }

    function update(string memory _newName) external {
        require(users[msg.sender].exists, "User not registered");
        users[msg.sender].name = _newName;
        emit UserUpdated(msg.sender, _newName);
    }
}

